import React from 'react';
import { Layout, Menu, Table, Card, Button, Row, Col } from 'antd';
import { UserOutlined, BellOutlined } from '@ant-design/icons';

const { Header, Content } = Layout;

const Dashboard = () => {
  // Hardcoded data for the table
  const dataSource = [
    {
      key: '1',
      customerName: 'Ahmad',
      issue: 'Computer Screen',
      startDate: '9/4/2024',
      deadline: '1 week',
      location: 'Khalda Amman sunshine company',
      technician: 'Rafi Barudak',
    },
    {
      key: '2',
      customerName: 'Ahmad',
      issue: 'Computer Screen',
      startDate: '9/4/2024',
      deadline: '1 week',
      location: 'Khalda Amman sunshine company',
      technician: 'Rafi Barudak',
    },
    {
      key: '3',
      customerName: 'Ahmad',
      issue: 'Computer Screen',
      startDate: '9/4/2024',
      deadline: '1 week',
      location: 'Khalda Amman sunshine company',
      technician: 'Rafi Barudak',
    },
  ];

  // Table columns
  const columns = [
    {
      title: 'Customer Name',
      dataIndex: 'customerName',
      key: 'customerName',
    },
    {
      title: 'Issues',
      dataIndex: 'issue',
      key: 'issue',
    },
    {
      title: 'Start Date',
      dataIndex: 'startDate',
      key: 'startDate',
    },
    {
      title: 'Deadline',
      dataIndex: 'deadline',
      key: 'deadline',
    },
    {
      title: 'Location',
      dataIndex: 'location',
      key: 'location',
    },
    {
      title: 'Technician',
      dataIndex: 'technician',
      key: 'technician',
    },
  ];

  return (
    <Layout>
      {/* Header */}
      <Header style={{ backgroundColor: '#fff', padding: '0 20px' }}>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <div style={{ fontSize: '1.5rem', fontWeight: 'bold' }}>Logo</div>
          <Menu mode="horizontal">
            <Menu.Item key="1">Dashboard</Menu.Item>
            <Menu.Item key="2">Knowledge</Menu.Item>
          </Menu>
          <div>
            <BellOutlined style={{ fontSize: '1.5rem', marginRight: '20px' }} />
            <span style={{ fontSize: '1rem' }}>Amanda Smith</span>
          </div>
        </div>
      </Header>

      {/* Content */}
      <Content style={{ padding: '20px', backgroundColor: '#f0f2f5' }}>
        <h1 style={{ textAlign: 'center', marginBottom: '30px' }}>Customer Dashboard</h1>

        {/* Cards */}
        <Row gutter={16} justify="center" style={{ marginBottom: '20px' }}>
          <Col span={6}>
            <Card
              hoverable
              cover={
                <img
                  alt="Cost of job"
                  src="https://via.placeholder.com/150"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Cost of job" description={<Button type="primary">Find out</Button>} />
            </Card>
          </Col>
          <Col span={6}>
            <Card
              hoverable
              cover={
                <img
                  alt="Make a schedule"
                  src="https://via.placeholder.com/150"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Make a schedule" description={<Button type="primary">Schedule Now</Button>} />
            </Card>
          </Col>
          <Col span={6}>
            <Card
              hoverable
              cover={
                <img
                  alt="Submit a request"
                  src="https://via.placeholder.com/150"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Submit a request" description={<Button type="primary">Submit Now</Button>} />
            </Card>
          </Col>
        </Row>

        {/* Table */}
        <h2 style={{ textAlign: 'center', marginBottom: '20px' }}>History</h2>
        <Table dataSource={dataSource} columns={columns} pagination={false} />

        <div style={{ textAlign: 'center', marginTop: '20px' }}>
          <Button type="link">Load more</Button>
        </div>
      </Content>
    </Layout>
  );
};

export default Dashboard;
